import React, {Component} from 'react'
import { fileIcon } from './InnerTree'

class FileTreeElement extends Component {
    render() {
        const {pickComponent} = this.props;

        return (
            <div className={`tree-element__highlight`}>
                <button className={"tree-element__file"}
                        key={this.props.index}
                        onClick={() => { pickComponent(this.props.file.slice(0, -3)) }}>
                    {fileIcon}
                    {this.props.file}
                </button>
             </div>
        )
    }
}

